import axios from 'axios';

const AppLogin = async (username, password) => {
     const response = await axios({
        method: 'post',
        url: 'http://localhost:5000/projects',
        data: {
          username: username,
          password: password
        }
      });
      console.log(response);
}

export default AppLogin
